import Layout from "../components/Layout";

import "antd/dist/antd.css";

import { Carousel } from "antd";

const Index = () => {
  return (
    <Layout>
      <div>
        <h2 className="text-center">Home Page</h2>
        <div>
          <Carousel autoplay>
            <div>
              <h3>1</h3>
            </div>
            <div>
              <h3>2</h3>
            </div>
            <div>
              <h3>3</h3>
            </div>
            <div>
              <h3>4</h3>
            </div>
          </Carousel>
        </div>
      </div>
    </Layout>
  );
};

export default Index;
